// sm
@media screen and (min-with: 640px) {
}

// md
@media screen and (min-with: 768px) {
}

// lg
@media screen and (min-with: 1024px) {
}

// xl
@media screen and (min-with: 1280px) {
}

// 2xl
@media screen and (min-with: 1536px) {
}
